export default data => {
  const getdata = data.filter(item => item.iso_3166_1 === 'US');
  if (getdata.length === 0) return 'N/A';

  return getdata[0].release_dates.map(({ certification }) =>
    certification === '' ? 'n/a' : certification
  );
  //   const ff = getdata.find(({ certification }) =>
  //     certification !== '' ? certification : 'n/a'
  //   );
};

